const errorMessages = {
    
    MANDATORY_USERNAME: '* Username required',
    NETWORK_ERROR: 'There was a problem reaching your network, please try again',
    LOGIN_REQUIRED: 'Please login to chat ',
    DEFAULT: 'Oh no!  Something went wrong, please try again later',
    UNAUTHORIZED_ACCESS: 'Unauthorized user. Please enter valid username!',
    MANDATORY_MESSAGE: '* Please enter a message',
  };
  
  export default errorMessages;
